import Login from '../views/Login/index';
import Regist from '../views/EntryJourney/Regist/index';
import Forget from '../views/EntryJourney/ForgetPassword/index';
import Activate from '../views/EntryJourney/Activate/index';
import HomePage from '../views/HomePage/index';
import DocterSchedulePage from '../views/DocterSchedulePage/index';
import DatabasePatientsPage from '../views/DatabasePatientsPage/index';
import DetailPatient from '../views/DatabasePatientsPage/detail-patient';
import ListStaffPage from '../views/ListStaffPage/index';
import PoliPage from '../views/PoliPage/index';

export const MainRoutes = [
  {
    path: '/',
    exact: true,
    component: Login,
  },
  {
    path: '/registration',
    component: Regist,
  },
  {
    path: '/forget',
    component: Forget,
  },
  {
    path: '/activate',
    component: Activate,
  },
  {
    path: '/home',
    component: HomePage,
  },
  {
    path: '/docter-schedule',
    component: DocterSchedulePage,
  },
  {
    path: '/database-patients',
    component: DatabasePatientsPage,
  },
  {
    path: '/detail-patient',
    component: DetailPatient,
  },
  {
    path: '/staff-list',
    component: ListStaffPage,
  },
  {
    path: '/poli-list',
    component: PoliPage,
  },
];
